export default function Registerpage(){
  return(
    <div>
      <form className="register">
        <h1></h1>
        <input type="text" placeholder="username"/>
        <input type="password" placeholder="password"/>
        <button type="Register">Register</button>
      </form>
    </div>
  )
}
